query:
/*+ NoMergeJoin(mi_idx t) */ select count(*)
from movie_info_idx AS mi_idx
inner join title AS t
on t.id = mi_idx.movie_id AND mi_idx.info_type_id > 100 AND t.kind_id > 1 AND t.production_year < 1969
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id > 2222583 AND ci.role_id > 1;
